import { RangeSelector } from "grommet";
import PropTypes from "prop-types";
import React from "react";
const propTypes = {
  dates: PropTypes.arrayOf(PropTypes.string).isRequired
};
const defaultProps = {};

export default function TimeBar({ dates }) {
  const [values, handleChange] = React.useState([12, 13]);
  return (
    <section className="h3 ma3">
      {/* {dates &&
        dates.forEach(element => {
          helo;
        })} */}
      <div className="flex justify-around relative top-2">
        {new Array(24).fill("").map((value, index) => (
          <div
            key={index}
            className={`bn tc w-100 ${(index <= 4 || index >= 19) &&
              "bg-light-gray"}`}
          >
            <p className={`code pb2 tl pl2`}>{index + 1}</p>
          </div>
        ))}
      </div>
      <RangeSelector
        values={values}
        min={0}
        max={24}
        step={1}
        color="#7D52D8"
        className="relative  bottom-2 pt1"
        onChange={handleChange}
        messages={{ lower: "A", upper: "B" }}
      />
    </section>
  );
}

TimeBar.propTypes = propTypes;
TimeBar.defaultProps = defaultProps;
